class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/48551/">醉佳导演</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%B4%BA%E5%86%9B%E7%BF%94------------/" target="_blank">贺军翔</a>&nbsp;<a href="/s/-%E6%B1%9F%E8%8B%A5%E7%90%B3------------/" target="_blank">江若琳</a>&nbsp;<a href="/s/-%E5%88%98%E5%AE%87------------/" target="_blank">刘宇</a>&nbsp;<a href="/s/-%E5%A7%9A%E6%A9%B9------------/" target="_blank">姚橹</a>&nbsp;<a href="/s/-%E6%A2%81%E5%A4%A9------------/" target="_blank">梁天</a>&nbsp;<a href="/s/-%E7%8E%8B%E5%AD%90------------/" target="_blank">王子</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%AD%A6%E5%9C%A3%E5%9F%BA--------/" target="_blank">武圣基</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/11/" target="_blank">剧情片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>中学教师沈东宝（贺军翔 饰），因为梦见自己获得国际最佳导演而立下誓言，立志要拍摄一部国际水准的大片沈东宝开始为自己的“大片”拉投资找赞助，最终通过七大姨八大姑凑够了五万多，在找资金的同时沈东宝也在寻找适合的演员。无意间他碰到力争上位梦想成为大明星的千千（江若琳 饰），最终在她的百般献媚中，沈东宝敲定</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/48551/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margi